Definition:
Representational state transfer (REST) is a software architectural style that defines a set of constraints to be used for creating Web services,  introduced and defined in 2000 by Roy Fielding in his doctoral dissertation. HTTP-based RESTful APIs are defined with the following aspects:

-a base URI, such as http://api.example.com/collection/;
-standard HTTP methods (e.g., GET, POST, PUT, PATCH and DELETE);
-a media type that defines state transition data elements
